                <div class="panel-heading">DOCUMENTO</div>
                <div class="panel-body">
                    <h4 class="card-title">Carteira de Estudante Digital</h4>
                    <script>
                        function displayTime() {
                          var daysOfWeek = ["Domingo","Segunda-Feira", "Terça-Feira", "Quarta-Feira", "Quinta-Feira", "Sexta-Feira", "Sabado"];
                          var monthsInPortuguese = ["Janeiro", "Fevereiro", "Março", "Abril", "Maio", "Junho", "Julho", "Agosto", "Setembro", "Outubro", "Novembro", "Dezembro"];;
                          var currentTime = new Date();
                          var hours = currentTime.getHours();
                          var minutes = currentTime.getMinutes();
                          var seconds = currentTime.getSeconds();
                          document.getElementById("time").innerHTML = `Vila Velha, ${daysOfWeek[currentTime.getDay()]}, ${currentTime.getDate()} de ${monthsInPortuguese[currentTime.getMonth()]} de 2023 às ${hours} horas e ${minutes} minutos`;
                        }
                      
                        setInterval(displayTime, 1);
                      </script>

                    <p id="time" class="card-text"></p>
                </div>
            </div>
